public int sum (int n)
{
	if (n -- 1):
		return 1;
	else:
		return n + sum (n-1);
}

public int result (int n)
{
	if (n == 1):
		return 2;
	else:
		return 2*result (n - 1);
}

public int mystery (int n, int a, int d):
{
	if (n == 1):
		return a;
	else:
		return d + mystery (n-1, a, d);
}

